import './Main.css';

const Main = () => {
  return (
    <main className='main'>
      <h1>Be Safe!</h1>
      <p>
        Do you always recive anonymous phone calls ? Do You always recive Fraud
        Email or URLs ?
      </p>
      <a href='#choose'>
        <button type='button' class='btn btn-outline-success mt-5 px-5 py-4'>
          GET STARTED
        </button>
      </a>
    </main>
  );
};
export default Main;
